            </div>

            <div className="bottom">
            <label>Thêm bài viết mới:</label>
            <input value="Thêm" type="button" onclick="addPost()"/>
            </div>

            <div className="borderContent">
            <p className="content">this.content</p>
            <div className="borderComment">
                <label style={"margin-left: 10px;"}>Bình luận</label>
                
                <p className="comment">this</p>
                
            </div>
            
            </div>
        </>
    )
}

export default Home;
